;; **
;;; Import of `generation-config`  from SPEA-2 worksheet to control every aspect of the run. 
;;; 
;;; `generation-config` is already present in core.clj but we explicitly defn it here to allow tunable inputs.
;; **

;; @@
(def generation-config
  (let [size-limit 120                   ; let used to spell out params ect.
        min-size 20
        ea-config (spea2/spea2-config
                    {:goals [:error :complexity]
                     :archive-size 50
                     :binary-ops [{:op (partial genetics/ninety-ten-sl-crossover size-limit) :repeat 23}]
                     :unary-ops [{:op (partial genetics/random-tree-mutation spea2-functions spea2-terminals 3) :repeat 4}]})
        score-functions {:complexity tree/count-nodes
                         :error (fn [ex] (score/abs-error vars coords spea2-data ex))}]
    {:ea-config              ea-config
     :transformations        [(partial transform/apply-to-fraction-of-genotypes
                                       (partial transform/hill-descent
                                                genetics/twiddle-constants
                                                (:error score-functions))
                                       0.5)
                              (partial transform/apply-to-all-genotypes
                                       (partial genetics/trim-hard size-limit))
                              (partial transform/apply-to-all-genotypes
                                       (partial genetics/boost-hard min-size
                                                #(genetics/random-full-tree spea2-functions spea2-terminals 3)))]
     :score-functions        score-functions
     :reporting-function     (fn [z] (print "Zzz") (flush))}))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;joel-darwin/generation-config</span>","value":"#'joel-darwin/generation-config"}
;; <=

